  input: TEXT,F3XN,,"A receipt in the amount of $35.58 on 12/06/2006 from Kris Kohler
    was for reimbursed credit card expenditures. The Mason Tenders' District Council
    of Greater New York and Long Island (aka MTDCGNYLI; the Mason Tenders District
    Council of Greater New York; & the Mason Tenders District Council); the Mason
    Tenders District Council Trust Funds; the Mason Tenders Trust Funds; the Mason
    Tenders D.C. Trust Funds; & the Mason Tenders Welfare Fund are not non-federal
    accounts of our committee. MTDCGNYLI is an umbrella organization representing
    locals of the Laborers' International Union of North America in the NY metropolitan
    area. The Mason Tenders District Council Trust Funds; the Mason Tenders Trust
    Funds; the Mason Tenders D.C. Trust Funds; & the Mason Tenders Welfare Fund are
    ERISA trust funds handling MTDCPAC employee's health & pension benefits. These
    trust funds also act as our collecting agent. Further, the MTDCPAC leases office
    space from the trust funds. Disclosed payments include rent & ancillary services
    such as trash pick-up, utilities, etc. Contributions received were $.05 or $.10
    contributions from individual union members. Any contributors who reach the aggregate
    $200 reporting limit are itemized by FECFile."
